/* This function is called from within the Flash player */
                        function ap_stopAll(playerID) {
                        for(var i = 1;i<=document.getElementsByTagName("object").length;i++) {
                        var currentID = "audioplayer"+i.toString();
                        if(i != playerID) {
                        document.getElementById(currentID).SetVariable("closePlayer", 1);
                        } else {
                        document.getElementById(currentID).SetVariable("closePlayer", 0);
                        }
                        }
                        }

                        /* The Hijax object is a collection of reusable methods for Ajax requests */

                        var Hijax = new function() {

                        this.getFormValues = function(element) {
                        var data = '';
                        var inputs = $(element).find(':input');
                        for (var i=0; i<inputs.length; i++) {
                        var name = $(inputs[i]).attr('name');
                        var value = $(inputs[i]).val();
                        value = value.replace('&','%26');
                        data+= name+'='+value+'&';
                        }
                        return data;
                        };

                        this.setFeedback = function(element,text) {
                        window.status = text;
                        $('body').append('<span role="status">'+text+'</span>');
                        var feedback = 'span:last';
                        var y = $(element).offset().top;
                        var x = $(element).offset().left;
                        x = x + Math.round(($(element).outerWidth())/2);
                        x = x - Math.round(($(feedback).outerWidth())/2);
                        $(feedback).css({
                        'position' : 'absolute',
                        'left' : x+'px',
                        'top': y+'px'
                        }).animate({
                        'opacity': 0,
                        'top': '-=75'
                        },
                        750,
                        'linear',
                        function() {
                        $(this).remove();
                        window.status = '';
                        });
                        };

                        this.showLoading = function(element) {
                        $('body').append('<img src="/images/ajax-loader.gif"
                        alt="'+config['ui']['loading']+'">');
                        var loader = $('img:last');
                        var y = $(element).offset().top;
                        y = y + Math.round(($(element).outerHeight())/2);
                        y = y - Math.round((loader.outerHeight())/4);
                        var x = $(element).offset().left;
                        x = x + $(element).outerWidth();
                        loader.css({
                        'position' : 'absolute',
                        'left' : x+'px',
                        'top': y+'px'
                        });
                        return loader;
                        };

                        this.prepare = function(element) {
                        $(element).attr({
                        'aria-live' : 'polite',
                        'aria-atomic' : 'true',
                        'aria-busy' : 'false'
                        });
                        };

                        this.startLoading = function(element) {
                        $(element).attr('aria-busy','true');
                        };

                        this.stopLoading = function(element) {
                        $(element).attr('aria-busy','false');
                        };

                        };

                        jQuery(function($) {

                        $('body').addClass('hasJS');

                        $('input:password').each(function() {
                        var password_field = this;
                        var id = $(password_field).attr('id');
                        $(password_field).after('<input type="text">');
                        var text_field = $(password_field).next();
                        $(text_field).val($(password_field).val());
                        $(text_field).css('display','none');
                        $(text_field).after('<span class="passwordtoggle"><input
                        type="checkbox" id="'+id+'-checkbox"> <label for="'+id+'-checkbox">'+config['ui']['show
                        password']+'</label></span>');
                        var checkbox = $('#'+id+'-checkbox');
                        $(checkbox).click(function(){
                        $(password_field).toggle();
                        $(text_field).toggle();
                        });
                        $(password_field).keyup(function(){
                        $(text_field).val($(password_field).val());
                        });
                        $(text_field).keyup(function(){
                        $(password_field).val($(text_field).val());
                        });
                        });

                        $('input[readonly]').click(function() {
                        this.focus();
                        this.select();
                        });

                        $('form.networking').each(function() {
                        Hijax.prepare(this);
                        });

                        $('form.networking button').live('click',function() {
                        var loader = Hijax.showLoading(this);
                        var text = $(this).text();
                        var message = config['feedback'][text];
                        var container = $(this).parent('form.networking');
                        var data = Hijax.getFormValues(container);
                        var url = container.attr('action');
                        Hijax.startLoading(container);
                        $.ajax({
                        type: "POST",
                        url: url,
                        data: data,
                        success: function(markup) {
                        loader.remove();
                        Hijax.setFeedback(container,message);
                        container.replaceWith(markup);
                        Hijax.stopLoading(container);
                        }
                        });
                        return false;
                        });

                        $('.hentry[role="article"] a.button').attr('role','button');

                        $('.hentry[role="article"]
                        a.button').parent('.hentry[role="article"]').each(function() {
                        Hijax.prepare(this);
                        });

                        $('.hentry[role="article"] a.button').live('click',function() {
                        var loader = Hijax.showLoading(this);
                        var url = $(this).attr('href');
                        var container = $(this).parent('.hentry[role="article"]');
                        Hijax.startLoading(container);
                        $.ajax({
                        type: "GET",
                        url: url,
                        success: function(markup) {
                        loader.remove();
                        container.html(markup);
                        Hijax.stopLoading(container);
                        }
                        });
                        return false;
                        });

                        $('.hentry[role="article"] form
                        button[type="submit"]').live('click',function() {
                        var loader = Hijax.showLoading(this);
                        var form = $(this).parent('form');
                        var url = form.attr('action');
                        var data = Hijax.getFormValues(form);
                        var container = form.parent('.hentry[role="article"]');
                        Hijax.startLoading(container);
                        $.ajax({
                        type: "POST",
                        url: url,
                        data: data,
                        success: function(markup) {
                        loader.remove();
                        container.html(markup);
                        Hijax.stopLoading(container);
                        }
                        });
                        return false;
                        });
                        });

                        (function (win, doc) {
                        if (('standalone' in win.navigator) && win.navigator.standalone
                        && win.addEventListener) {
                        var links = doc.getElementsByTagName('a'),
                        total = links.length,
                        i;
                        for (i = 0; i < total; i = i + 1) {
                        links[i].addEventListener('click', function(ev) {
                        var dest = this.getAttribute('href');
                        if (!dest.match(/^http(s?)/g)) {
                        ev.preventDefault();
                        win.location = dest;
                        }
                        });
                        }
                        }
                        }(this, this.document));
